export class datenschutz extends Component {
  render() {
    return (
      <div className="maincontainer">
        <div className="headline">
          <span>DATENSCHUTZ</span>
        </div>
        <div className="addcontainer">
          <span className="inhalttextLinks">
            Datenschutz Text
